import React, { Component } from "react";
import Box from "./Row/Box/Box";
import Row from "./Row/Row";
import ReactDOM from "react-dom";
import "./Grid.css";
class Grid extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div id="grid_container">
        <table id="grid-table">
          <tbody>
          <Row />
          </tbody>
        </table>
      </div>
    );
  }

  PrintEle(ele) {
    console.log(ele);
  }
}

export default Grid;
